    initDateTimePicker('departureYear', 'departureMonth', 'departureDay', 'departureHour', 'departureMinute', 7);
    initDateTimePicker('queryYear', 'queryMonth', 'queryDay', 'queryStartHour', 'queryStartMinute', 7);
