    // æ‰‹æœºå·éªŒè¯ï¼ˆå®½æ¾ä½†æœ‰æ•ˆè§„åˆ™ï¼‰
    function validatePhone(phone) {
      // 1å¼€å¤´ï¼Œç¬¬äºŒä½3-9ï¼Œæ€»å…±11ä½
      // è¦†ç›–æ‰€æœ‰è¿è¥å•†ï¼šç§»åŠ¨/è”é€š/ç”µä¿¡/å¹¿ç”µ/è™šæ‹Ÿè¿è¥å•†ï¼ˆ13x-19xå·æ®µï¼‰
      // è‡ªåŠ¨å…¼å®¹æœªæ¥æ–°å·æ®µ
      const phonePattern = /^1[3-9]\\d{9}$/;
      const result = phonePattern.test(phone);

      // è°ƒè¯•è¾“å‡º
      console.log('æ‰‹æœºå·éªŒè¯:', {
        input: phone,
        length: phone.length,
        pattern: phonePattern.toString(),
        result: result
      });

      return result;
    }

