// å†…å­˜ä¸­çš„ä¸´æ—¶å°ç¦ç¼“å­˜å’Œè®¿é—®è®°å½•
const IP_BAN_CACHE = new Map(); // IPå°ç¦ç¼“å­˜ï¼škey=IP, value=è§£å°æ—¶é—´æˆ³
const IP_ACCESS_LOG = new Map(); // è®¿é—®è®°å½•ï¼škey=IP, value=è®¿é—®æ—¶é—´æˆ³æ•°ç»„

// æ¸…ç†è¿‡æœŸçš„è®¿é—®è®°å½•ï¼ˆä¿ç•™æœ€è¿‘2åˆ†é’Ÿï¼‰
function cleanupAccessLog() {
  const now = Date.now();
  const twoMinutesAgo = now - 120000;

  for (const [ip, timestamps] of IP_ACCESS_LOG.entries()) {
    const validTimestamps = timestamps.filter(t => t > twoMinutesAgo);
    if (validTimestamps.length === 0) {
      IP_ACCESS_LOG.delete(ip);
    } else {
      IP_ACCESS_LOG.set(ip, validTimestamps);
    }
  }
}

// åçˆ¬è™«æ£€æŸ¥
async function checkCrawler(ua, ip, env) {
  // ç™½åå•IPè·³è¿‡æ‰€æœ‰æ£€æŸ¥
  if (IP_WHITELIST.includes(ip)) {
    return { allowed: true };
  }

  // UAæ£€æŸ¥
  const lowerUA = ua.toLowerCase();
  for (const pattern of CRAWLER_PATTERNS) {
    if (lowerUA.includes(pattern)) {
      return { allowed: false, reason: 'Crawler detected' };
    }
  }

  const now = Date.now();

  // æ£€æŸ¥å†…å­˜ç¼“å­˜ä¸­çš„IPå°ç¦
  const banUntil = IP_BAN_CACHE.get(ip);
  if (banUntil && banUntil > now) {
    return { allowed: false, reason: 'IP banned' };
  } else if (banUntil && banUntil <= now) {
    // å°ç¦å·²è¿‡æœŸï¼Œåˆ é™¤
    IP_BAN_CACHE.delete(ip);
  }

  // é¢‘ç‡æ£€æŸ¥ï¼šç»Ÿè®¡æœ€è¿‘1åˆ†é’Ÿçš„è®¿é—®æ¬¡æ•°
  const oneMinuteAgo = now - 60000;
  const accessLog = IP_ACCESS_LOG.get(ip) || [];
  const recentAccess = accessLog.filter(t => t > oneMinuteAgo);

  if (recentAccess.length >= MAX_REQUESTS_PER_MINUTE) {
    // è¶…è¿‡é™åˆ¶ï¼Œå°ç¦24å°æ—¶
    IP_BAN_CACHE.set(ip, now + BAN_DURATION);
    return { allowed: false, reason: 'Rate limit exceeded' };
  }

  // è®°å½•æœ¬æ¬¡è®¿é—®
  recentAccess.push(now);
  IP_ACCESS_LOG.set(ip, recentAccess);

  // å®šæœŸæ¸…ç†è¿‡æœŸè®°å½•ï¼ˆæ¯100æ¬¡è¯·æ±‚æ¸…ç†ä¸€æ¬¡ï¼‰
  if (Math.random() < 0.01) {
    cleanupAccessLog();
  }

  return { allowed: true };
}

// è®¿å®¢ç»Ÿè®¡
async function trackVisitor(request, ip, ua, env) {
  const cf = request.cf || {};
  const country = cf.country || 'Unknown';
  const city = cf.city || 'Unknown';
  const now = Date.now();

  // åŒæ—¶è®°å½•UVå’ŒPVï¼šcountå­—æ®µè®°å½•è®¿é—®æ¬¡æ•°ï¼ˆPVï¼‰
  await env.DB.prepare(`
    INSERT INTO visitors (ip, ua, country, city, count, last_visit)
    VALUES (?, ?, ?, ?, 1, ?)
    ON CONFLICT(ip) DO UPDATE SET
      count = count + 1,
      last_visit = ?,
      ua = ?,
      country = ?,
      city = ?
  `).bind(ip, ua, country, city, now, now, ua, country, city).run();
}

// é«˜å¾·åœ°å›¾æœç´¢API
async function handleSearch(request, env) {
  const url = new URL(request.url);
  const keywords = url.searchParams.get('keywords');

  if (!keywords) {
    return jsonResponse({ error: 'Missing keywords' }, 400);
  }

  const AMAP_KEY = env.AMAP_KEY;
  if (!AMAP_KEY) {
    console.error('é«˜å¾·åœ°å›¾API Keyæœªé…ç½®');
    return jsonResponse({ error: 'API key not configured', tips: [] }, 500);
  }

  const apiUrl = `https://restapi.amap.com/v3/assistant/inputtips?key=${AMAP_KEY}&keywords=${encodeURIComponent(keywords)}&city=è¥¿å®‰`;

  try {
    const response = await fetch(apiUrl);
    const data = await response.json();

    console.log('é«˜å¾·APIè¿”å›:', { keywords, status: data.status, count: data.count, info: data.info });

    // é«˜å¾·APIè¿”å›æ ¼å¼ï¼šstatus=1è¡¨ç¤ºæˆåŠŸï¼Œtipsæ˜¯ç»“æœæ•°ç»„
    if (data.status === '0') {
      console.error('é«˜å¾·APIé”™è¯¯:', data.info);
      return jsonResponse({ error: data.info, tips: [] });
    }

    return jsonResponse(data);
  } catch (error) {
    console.error('é«˜å¾·APIè¯·æ±‚å¤±è´¥:', error);
    return jsonResponse({ error: 'API request failed', tips: [] }, 500);
  }
}

