  // ç¡®ä¿æ‰€æœ‰å­—ç¬¦ä¸²å­—æ®µéƒ½æ˜¯å­—ç¬¦ä¸²ç±»å‹
  name = typeof name === 'object' ? JSON.stringify(name) : String(name);
