  // éªŒè¯æ‰‹æœºå·æ ¼å¼ï¼ˆå®½æ¾ä½†æœ‰æ•ˆè§„åˆ™ï¼‰
  // 1å¼€å¤´ï¼Œç¬¬äºŒä½3-9ï¼Œæ€»å…±11ä½ï¼ˆè¦†ç›–æ‰€æœ‰è¿è¥å•†13x-19xå·æ®µï¼‰
  const phonePattern = /^1[3-9]\d{9}$/;
